    <h2 class="faqs__head h5 d-flex align-items-center py-10 mb-0 cursor-pointer" data-js-accordion-button=""><span class="mr-15">- How long will it take to process and ship my order if it contains any pre-order/back-order items?</span> <i class="faqs__cross ml-auto"><!--?xml version="1.0" encoding="utf-8"?-->
<!-- Generator: Adobe Illustrator 17.0.0, SVG Export Plug-In . SVG Version: 6.00 Build 0)  -->

<svg aria-hidden="true" focusable="false" role="presentation" class="icon icon-theme-190" viewBox="0 0 24 24">
<g>
	<path d="M7.718,15.966c-0.117-0.13-0.176-0.279-0.176-0.449c0-0.169,0.059-0.318,0.176-0.449l3.32-3.301l-3.32-3.301
