</i> </h2>
    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">Once a product releases in Korea, it takes about <b>2~3 business days</b>** for it to arrive at our warehouse in the U.S. (if there are no unexpected delays). Upon arrival, order processing will begin (detailed shipping updates can be found on our social media).

<p><br>Orders are typically processed within <b>2~3 business days</b>** (normal volume) if all items in the order are in stock. For high volume orders, it can take anywhere between <b>5~8 business days</b>** for processing. The shipping speed applies after the order has been processed.

</p><p>Due to the effects of COVID-19, shipping to some countries may be restricted, in which case, orders may be automatically cancelled or packages may be automatically returned, so please check your country's shipping restrictions before placing an order.

</p><p><b>Please remember to film a full, unedited Unboxing Video from beginning to end</b>, check the product condition immediately upon receipt, and contact our Customer Support department at <a href="mailto:ask@subkshop.com"><font color="#2ad687"><u>ask@subkshop.com</u></font></a> for damaged, defective, incorrect, or missing items.

</p><p>See our full Return &amp; Exchange Policy <a href="https://www.subkshop.com/pages/returns-exchanges"><font color="#2ad687"><u>here</u></font></a>.

</p><p>** Subject to change based on operational circumstances. Excludes weekends and holidays.

</p><p>** Please note that this info is also provided on each product page and may be adjusted based on any changes that occur or any updates we receive from our distributors, artist management, etc.</p>


      </div>
    </div>
    </div><div class="faqs border-top" data-js-accordion="all">
    <h2 class="faqs__head h5 d-flex align-items-center py-10 mb-0 cursor-pointer" data-js-accordion-button=""><span class="mr-15">- If I purchase pre-order items and in-stock items (non-pre-order) in the same order, will my in-stock items ship first?</span> <i class="faqs__cross ml-auto"><!--?xml version="1.0" encoding="utf-8"?-->
