    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">If you place an order that includes one or more items that are pre-orders or back-orders, shipping will occur once all items within that order are available to ship together. Please place separate orders if you would like in-stock items shipped sooner than any pre-order or back-order items.

<p><br>** Processing &amp; shipping times are subject to change based on operational circumstances, and excludes weekends and holidays.

</p><p>** Please note that this info is also provided on each product page and may be adjusted based on any changes that occur or any updates we receive from our distributors, artist management, etc.</p>


      </div>
    </div>
    </div><div class="faqs border-top" data-js-accordion="all">
