    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">Your confirmation email will be sent to the email address you used to place the order. If it doesn’t appear in your inbox after you’ve waited at least <b>2~3 business days</b>**, your bank may still be processing your transaction (this varies per bank)!

<p><br>If you still don’t receive a confirmation email after <b>3 business days</b>, please email Customer Support at <a href="mailto:ask@subkshop.com"><font color="“#2ad687”"><u>ask@subkshop.com</u></font></a>, and a team member will be able to assist you.

</p><p>** Excludes weekends and holidays.</p>


      </div>
    </div>
