    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">In some cases, if you don’t immediately receive your confirmation email after you make your purchase, it may mean that the transaction is still "pending" with your bank. Processing can typically take up to <b>2~3 business days</b>** (varies per bank).

<p><br>Once the transaction has been processed, a confirmation email will be sent to the email address you used to place the order. Please wait <b>at least 3 business days</b>, and if you still don’t receive a confirmation email, please email Customer Support at <a href="mailto:ask@subkshop.com"><font color="“#2ad687”"><u>ask@subkshop.com</u></font></a>, and a team member will be able to assist you.

</p><p>** Excludes weekends and holidays.</p>


      </div>
    </div>
    </div><div class="faqs border-top" data-js-accordion="all">
