</i> </h2>
    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">Please email Customer Support at <a href="mailto:ask@subkshop.com"><font color="“#2ad687”"><u>ask@subkshop.com</u></font></a>, and a team member will be able to assist you with any changes or adjustments to your order.

<p><br>Keep in mind that although we can change versions (if in stock), members (if in stock), names, email addresses, phone numbers, and shipping addresses, we cannot include/remove/separate items, nor change billing addresses.

</p><p>If you require assistance for the latter, please request to cancel your order so that you can place a new order with the correct information and/or items!</p>


      </div>
