    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">We ship unfolded posters in poster tubes separately from albums and after albums have shipped first, unless they are already folded inside. Depending on the volume of orders per album, it may take <b>2~3 business days</b>** after albums are shipped to process posters. If you placed an order for an album with an unfolded poster and have received one of either first, please allow <b>5~7 business days</b>** for the other to be delivered!

