    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">If you have received a damaged, defective, or incorrect item(s), or are missing an item(s), please email <a href="mailto:ask@subkshop.com"><font color="#2ad687"><u>ask@subkshop.com</u></font></a> with the following info <b>within 7 days</b> of when the shipment was marked as <b>delivered</b> by the courier: <b>First</b> and <b>Last Name</b>, <b>Order Number</b>, <b>Explanation of Issue</b>, <b>Unboxing Video</b>**, and <b>Preference of Resolution</b> (refund, exchange, or replacement of missing item(s)).

<p><br>** As written in all of our product descriptions, an Unboxing Video is standard protocol for any of our merchandise inquiries. A proper Unboxing Video records the package that you received and the contents inside from beginning to end <b>UNEDITED</b> - from the moment you open the box and unwrap each item, to the point where you can point out the missing item(s) (e.g, album inclusions or extra items that should have been received), incorrect item(s), or the damaged and/or defective item(s). Please be aware that we will not be able to assist you with your inquiries until we receive an Unboxing Video.

</p><p>See our full Return &amp; Exchange Policy <a href="https://www.subkshop.com/pages/returns-exchanges"><font color="#2ad687"><u>here</u></font></a>.</p>


