    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30"><b>Credit Card</b>: Visa, MasterCard, Discover, American Express, JCB, Visa Electron.
<p><br>↳ Prepaid gift cards from the companies listed above are also acceptable. As the terms of use, conditions, and refund policies are different than that of debit/credit cards, please familiarize yourself with them before using this payment method.

</p><p><b>Express Checkout</b>: Apple Pay, Google Pay, PayPal, Shop Pay
</p><p>↳ PayPal: Shop easily online without having to enter your credit card details on the website. Your account will be charged once the order is completed. To register for a PayPal account, please visit <a href="https://www.paypal.com/"><u><font color="blue">www.paypal.com</font></u></a>.

</p><p>↳ Shop Pay: Shop Pay is an accelerated checkout that lets customers save their email address, credit card, and shipping and billing information so that they can complete their transaction faster the next time they checkout. For more info about Shop Pay, please visit <a href="https://shop.app/help/shop-pay"><u><font color="blue">https://shop.app/help/shop-pay</font></u></a>.

</p><p>↳ Shop Pay Installments: Buy now, pay later -- in 4 equal payments, interest-free, and with no additional or hidden costs for orders between $50 and $1000! Paying in installments with Shop Pay is powered and serviced by Affirm.

</p><p>When you check out with Shop Pay for eligible orders, you have the option to pay in full at checkout, or to split your purchase into 4 equal installment payments. Installments are a flexible payment option that can help you invest in larger purchases up to $1000 by dividing your purchase amount into four equal, biweekly, and interest-free payments.
</p><hr>
<p>To pay in installments with Shop Pay in a participating store, <b>you need to meet the following requirements:</b>
</p><p>- Reside in the United States
<br>- <a href="https://shop.app/pay/authentication/login"><u><font color="blue">Sign up for Shop Pay</font></u></a>
<br>- Add your debit or credit card to your Shop Pay account

</p><hr>
<p>The following limitations currently apply to paying in installments with Shop Pay:
</p><p>- You can't pay for an order in installments if the order <b>includes currency in any form, including virtual and digital currency, like gift cards</b>.
<br>- To qualify, orders need to be between $50 and $1000 USD, inclusive of shipping and taxes.
<br>- If you change your phone number or email within Shop Pay, then you also need to <a href="https://shoppay.affirm.com/help/s/article/update-my-phone-number-sp"><u><font color="blue">update your information with Affirm</font></u></a> before you can pay for another purchase in installments with Shop Pay.

</p><p>For more info about and support for Shop Pay Installments, please visit <a href="https://shop.app/help/installments"><u><font color="blue">https://shop.app/help/installments</font></u></a>.</p>


      </div>
