    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30">Yes, we ship to the U.S. and worldwide with the exception of a few countries.

<p><br><b>FOR INTERNATIONAL (NON-U.S.) CUSTOMERS:</b>
</p><p>International packages may be subject to import taxes, customs duties, tariff, VAT, fees, etc imposed by the destination country. These charges will typically be due before delivery is attempted. Such charges are not included in the product price or shipping and handling cost, and are the customer’s responsibility as SubK Shop is only charging the transportation fee for the order. There is no way for SubK Shop to verify or anticipate what duties will be levied by a country upon delivery as charges vary across the world, so it is the customer’s full responsibility to check with their local postal or customs office to determine if there will be additional costs.

</p><p>Please note that international packages that exceed the max size/volume/weight may be split into separate packages and may be subject to additional customs/admin fees per package processed. Size/volume/weight standards are determined by and vary per destination, courier, and shipping speed selected by the customer.

</p><p><b>USA TO KOREA SHIPPING:</b>

</p><p>[한국 배송문의] 한국배송의 경우, 웹사이트를 통해 가장 저렴한 배송방법을 선택하셔서 결제하시면 됩니다. 배송 주소는 꼭 한글로 작성 부탁드리며, 1차로 결제하신 해외배송비에서 실배송시 사용되는 미국-&gt;한국 연결된 택배사 비용을 제외한 배송차액은 배송과 동시에 환불처리 됩니다. 환불의 최종처리는 결제하신 방법에 따라 약 3~5일 (주말/공휴일 제외) 소요됩니다.

</p><p>알림: 택배배송은 한국에 실거주 하시고 개인통관번호를 보유하고 계신 고객님께만 가능합니다. 배송정보 작성시 개인통관번호는 "Company" 칸에 작성하시면 되며, 한국내 배송정보를 배송대행지 또는 실거주자가 아닌 정보(이름, 우편번호, 주소, 전화번호 등등)를 기입하실 경우, 화물의 분실 및 추가 관세 등등 불이익이 발생할 수 있으며 해당 부분은 구매자 책임을 알려드립니다. 온라인 배송은 미국 로스엔젤레스에서 진행되며 미국&gt;한국 택배배송 관련 문의는 <a href="mailto:ask@subkshop.com"><font color="“#2ad687”"><u>ask@subkshop.com</u></font></a>로 주시면 한국어 가능한 담당자께서 안내 드리겠습니다.

</p><p>[Shipping to Korea] Regarding shipping to Korea, please choose the cheapest international shipping option to complete your purchase and make sure that the shipping address is written in Korean. The amount difference between the shipping fee paid at checkout and the actual Express shipping fee charged will be refunded at the time of shipping. The Express shipping service to Korea can only be utilized by customers who actually reside in Korea and have a Personal Customs Clearance Code (PCCC). When filling out your shipping address info, please include your PCCC in the "Company" field. If you submit shipping contact info (name, address, phone number, etc.) of trans-shipment proxy companies or non-Korean residents, packages may be delayed, lost, rejected, or charged additional customs fees, which will be the sole responsibility of the customer and SubK Shop will not be responsible for any loss, damage, or fees incurred. Online orders via the Express shipping service are shipped from Los Angeles, CA (USA). Any inquiries related to the USA&gt;Korea Express shipping service can be emailed to <a href="mailto:ask@subkshop.com"><font color="“#2ad687”"><u>ask@subkshop.com</u></font></a> and a team member will be able to assist you further in Korean.

</p><p><b>FOR DOMESTIC (U.S.) AND INTERNATIONAL (NON-U.S.) CUSTOMERS:</b>

</p><p>SubK Shop will not be held liable or responsible for any additional charges that may apply, and will not be responsible for abandoned packages (packages that are not delivered because the customer hasn’t paid the customs/duties fees due), mis-delivery errors via carrier, incorrect shipping info, stolen packages, losses, product, or shipping refunds. The customer accepts full responsibility to file any claim(s) with their carrier for damaged and/or lost shipments. It is the customer’s responsibility to cover the shipping costs if/when the customer wishes to have a second delivery attempt after the product is returned to SubK Shop.</p>


