    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30"><p>SubK Shop is fully registered to report album sales to count towards the Gaon and Hanteo charts. For the Gaon chart, sales will count for the first day and first week of release. For the Hanteo chart, sales will count once orders are shipped.

</p><p>As with any other U.S-based store, we cannot guarantee that all purchases of an album will be shipped out within the first day or first week of a release because this depends on how quickly our shipment arrives at our warehouse in the U.S. from our distributors in Korea. Albums are typically shipped to us on release day (sometimes later) and will typically take 2~3 business days to arrive (as long as there are no unexpected delays). While our fulfillment team tries their best to process orders quickly and efficiently after we receive shipment, every single order is hand-packed by our team members, so order volume may also impact shipment as well.</p>


      </div>
    </div>
    </div><div class="faqs border-top" data-js-accordion="all">
    <h2 class="faqs__head h5 d-flex align-items-center py-10 mb-0 cursor-pointer" data-js-accordion-button=""><span class="mr-15">- Will my album purchase count towards the Billboard charts?</span> <i class="faqs__cross ml-auto"><!--?xml version="1.0" encoding="utf-8"?-->
<!-- Generator: Adobe Illustrator 17.0.0, SVG Export Plug-In . SVG Version: 6.00 Build 0)  -->

