</i> </h2>
    <div class="d-none" data-js-accordion-content="">
      <div class="rte pt-10 pb-30"><p>As mentioned on our website, Billboard has very specific rules about how an album sale can count towards their charts.

</p><p>SubK Shop is fully registered to report any eligible sales to count towards the Billboard charts. However, the following are some of the main criteria that need to be met in order for an album to be eligible, according to Billboard's current rules:

</p><p>- Album must be registered for charting in the US
<br>- Album must be purchased in quantities of 4 or less per order
<br>- Album must ship to a US address
<br>- Album cannot have any loose items

</p><p>If one or more of the above criteria is not met, the album will not be eligible to count towards the Billboard charts, regardless of the seller's status with reporting or shipping.

</p><p>Please contact Billboard, Soundscan, MRC Data, or Nielsen directly for further clarification on the official rules, policies, limitations, and restrictions as they may be subject to change without our knowledge at any time, and they are overall best-equipped to answer any inquiries you may have!</p>


      </div>
