<h3><span style="color: #2ad867;"><b>[ ORDER PROCESSING &amp; SHIPPING TIMELINE ]</b></span></h3>
<p><span>Once a product releases in Korea, it takes about <strong>2~3 business days</strong>** for it to arrive at our warehouse in the U.S. (if there are no unexpected delays). Upon arrival, order processing will begin (detailed shipping updates can be found on our social media).</span></p>
<p><span>Orders are typically processed within <strong>2~3 business days</strong>** (normal volume) if all items in the order are in stock. For high volume orders, it can take anywhere between <strong>5~8 business days</strong>** for processing. The shipping speed applies after the order has been processed.</span></p>
<p><span>Due to the effects of COVID-19, shipping to some countries may be restricted, in which case, orders may be automatically cancelled or packages may be automatically returned, so please check your country's shipping restrictions before placing an order.</span></p>
<p><span>Please remember to film a full, unedited Unboxing Video from beginning to end,</span><span> check the product condition immediately upon receipt, and contact our Customer Support department at&nbsp;</span><span><a href="mailto:ask@subkshop.com">ask@subkshop.com</a> for damaged, defective, incorrect, or missing items. </span><span>(See Return &amp; Exchange and Cancellation Policies below.)</span></p>
<h4></h4>
<p><span>** Subject to change based on operational circumstances. Excludes weekends and holidays.</span></p>
<h4></h4>
<h3><span style="color: #2ad867;"><b>[ USA TO KOREA SHIPPING ]</b></span></h3>
<p><span>[한국 배송문의] 한국배송의 경우, 웹사이트를 통해 가장 저렴한 배송방법을 선택하셔서 결제하시면 됩니다. 배송 주소는 꼭 한글로 작성 부탁드리며, 1차로 결제하신 해외배송비에서 실배송시 사용되는 미국-&gt;한국 연결된 택배사 비용을 제외한 배송차액은 배송과 동시에 환불처리 됩니다. 환불의 최종처리는 결제하신 방법에 따라 약 3~5일 (주말/공휴일 제외) 소요됩니다.</span></p>
<p><span>알림: 택배배송은 한국에 실거주 하시고 개인통관번호를 보유하고 계신 고객님께만 가능합니다. 배송정보 작성시 개인통관번호는 "Company" 칸에 작성하시면 되며, 한국내 배송정보를 배송대행지 또는 실거주자가 아닌 정보(이름, 우편번호, 주소, 전화번호 등등)를 기입하실 경우, 화물의 분실 및 추가 관세 등등 불이익이 발생할 수 있으며 해당 부분은 구매자 책임을 알려드립니다. 온라인 배송은 미국 로스엔젤레스에서 진행되며 미국&gt;한국 택배배송 관련 문의는 <a href="mailto:ask@subkshop.com">ask@subkshop.com</a>로 주시면 한국어 가능한 담당자께서 안내 드리겠습니다.</span></p>
<p style="text-align: center;"><span style="color: #ff2a00;"><strong>일부 상품은 한국으로 배송이 불가능 할 수 있습니다. 상품별 판매 페이지 PRODUCT INFORMATION에 나와 있는 배송정보를 참고 하시기 바랍니다.</strong></span></p>
<p><span>[Shipping to Korea] Regarding shipping to Korea,</span><span> please choose the cheapest international </span><span>shipping option to complete your purchase and make sure that the shipping address is written in Korean. The amount difference </span><span>between the shipping fee</span><span> paid at checkout and the actual Express shipping fee charged will be refunded at the time of shipping. The Express shipping service to Korea can only be utilized by customers who actually reside in Korea and have a Personal Customs Clearance Code (PCCC). When filling out your shipping address info, please include your PCCC in the "Company" field. If you submit shipping contact info (name, address, phone number, etc.) of trans-shipment proxy companies or non-Korean residents, packages may be delayed, lost, rejected, or charged additional customs fees, which will be the sole responsibility of the customer and SubK Shop will not be responsible for any loss, damage, or fees incurred. Online orders via the Express shipping service are shipped from Los Angeles, CA (USA). Any inquiries related to the USA&gt;Korea Express shipping service can be emailed to&nbsp;</span><a href="mailto:ask@subkshop.com"><span>ask@subkshop.com</span></a> and a team member will be able to assist you further in Korean.</p>
<h4></h4>
<h3><span style="color: #2ad867;"><b>[ FOR INTERNATIONAL (NON-U.S.) CUSTOMERS ]</b></span></h3>
<p><span>International packages may be subject to import taxes, customs duties, tariff, VAT, fees, etc imposed by the destination country. These charges will typically be due before delivery is attempted. Such charges are not included in the product price or shipping and handling cost, and are the customer’s responsibility as SubK Shop is only charging the transportation fee for the order. There is no way for SubK Shop to verify or anticipate what duties will be levied by a country upon delivery as charges vary across the world, so it is the customer’s full responsibility to check with their local postal or customs office to determine if there will be additional costs.</span></p>
<p><span>Please note that international packages that exceed the max size/volume/weight may be split into separate packages and may be subject to additional customs/admin fees per package processed. Size/volume/weight standards are determined by and vary per destination, courier, and shipping speed selected by the customer.<br></span></p>
<h4></h4>
<h3><span style="color: #2ad867;"><b>[ FOR DOMESTIC (U.S.) AND INTERNATIONAL (NON-U.S.) CUSTOMERS ]</b></span></h3>
<p><span><strong>SubK Shop will not be held liable or responsible</strong> for any additional charges that may apply, and will not be responsible for abandoned packages (packages that are not delivered because the customer hasn’t paid the customs/duties fees due), mis-delivery errors via carrier, incorrect shipping info, stolen packages, losses, product, or shipping refunds. The customer accepts full responsibility to file any claim(s) with their carrier for damaged and/or lost shipments. It is the customer’s responsibility to cover the shipping costs if/when the customer wishes to have a second delivery attempt after the product is returned to SubK Shop.<br></span></p>
<h4></h4>
<h3><span style="color: #2ad867;"><b>[ ORDERS THAT INCLUDE PRE-ORDER/BACK-ORDER ITEMS ]</b></span></h3>
<p><span>If you place an order that includes one or more items that are in pre-order or back-order, shipping will occur once <strong>ALL</strong> items within that order are available to ship together, so please place separate orders if you would like in-stock items shipped sooner than any pre-order or back-order items.<br></span></p>
<h4></h4>
<h3><span style="color: #2ad867;"><b>[ CHANGES TO EXISTING ORDERS ]</b></span></h3>
<p style="text-align: center;"><span style="color: #ff0000;"><b>PLEASE NOTE THAT WE MAY NOT BE ABLE TO ACCOMMODATE SOME ADJUSTMENT REQUESTS FOR ORDERS INCLUDING CERTAIN PRODUCTS OR COLLECTIONS, SO MAKE SURE TO READ EACH PRODUCT PAGE CAREFULLY.</b></span></p>
<p><span>If you would like to make any changes to an existing order that has not been fulfilled/shipped (shipping address, contact info, version, etc), please email&nbsp;</span><a href="mailto:ask@subkshop.com"><span>ask@subkshop.com</span></a>with your <strong>First</strong> and <strong>Last Name</strong>, <strong>Order Number</strong>, and <strong>Details of Edit Request</strong>.</p>
<p><span>Please be aware that email address, shipping address, and item version/member changes are the only possible updates that we can make. If you would like to add/remove items from your order or change your billing address, you will have to cancel your order and place a new order with the items you want. </span><span>(See Return &amp; Exchange and Cancellation Policies below.)</span></p>
<p><span>For orders that are placed separately, even if they are under the same customer info, they will be shipped separately. If you would like multiple orders to ship together, you will need to email&nbsp;</span><a href="mailto:ask@subkshop.com"><span>ask@subkshop.com</span></a> and make a request to combine them.</p>
<h3><span style="color: #2ad867;"> <b>[ RETURN &amp; EXCHANGE POLICY ]</b>&nbsp;</span></h3>
<div style="text-align: center;"><span style="color: #ff2a00;"><b>AN UNBOXING VIDEO (DETAILS BELOW) IS STANDARD PROTOCOL FOR ANY OF OUR MERCHANDISE INQUIRIES. PLEASE ALWAYS FILM AN UNBOXING VIDEO IMMEDIATELY AFTER RECEIVING YOUR ORDER TO ENSURE YOU HAVE VIDEO PROOF OF ANY POTENTIAL ISSUES!<br><br></b></span></div>
<div style="text-align: center;"><span style="color: #ff2a00;"><b>YOU MUST CHECK THAT YOU HAVE RECEIVED ALL THE CORRECT ITEM(S)/VERSION(S) BEFORE UNWRAPPING THE PRODUCTS.<br><br></b></span></div>
<div style="text-align: center;"><span style="color: #ff2a00;"><b>IF A PRODUCT IS VISIBLY DAMAGED/DEFECTIVE/INCORRECT ON ITS EXTERIOR, PLEASE DO NOT UNWRAP THE PRODUCTS.<br><br></b></span></div>
<p><span>If you have received a damaged, defective, or incorrect item(s), or are missing an item(s), please email ask@subkshop.com with the following info <strong>within 7 days</strong> of when the shipment was marked as delivered by the courier: <strong>First</strong> and <strong>Last Name</strong>, <strong>Order Number</strong>, <strong>Explanation of Issue</strong>, <strong>Unboxing Video</strong>**, and <strong>Preference of Resolution</strong> (refund, exchange, or replacement of missing item(s)).</span></p>
<p><span><span style="font-weight: 400;">** An Unboxing Video is standard protocol for any of our merchandise inquiries. A proper Unboxing Video records the package that you received and the contents inside from beginning to end <strong>UNEDITED</strong> - from the moment you open the box and unwrap each item (unless there are visible, obtrusive exterior damages/defects to the items), to the point where you can point out the missing item(s) (e.g, album inclusions or extra items that should have been received), incorrect item(s), or the damaged and/or defective item(s). Please be aware that we will not be able to assist you with your inquiries until we receive an Unboxing Video.</span></span></p>
<p><span>For damaged/defective/incorrect item(s), our team will review the details, and once you are approved for a return/exchange, our team will send you a prepaid return label for the item(s) being returned/exchanged. Upon receiving the returned item(s), our team will review and issue immediate assistance in the form of: full refund (cost of returned item and shipping cost), store credit, or ship out a replacement -- whichever solution fits the reason for return/exchange.</span></p>
<p><span>For <span style="font-weight: 400;">products with visible, obtrusive&nbsp;exterior damages/defects** and/or&nbsp;</span>incorrect item(s)/version(s) received, <strong>please contact us first</strong> and <strong>DO NOT UNWRAP/UNSEAL/OPEN</strong> the product. In these cases, if the product is unwrapped/unsealed/opened, we will not be able to accept/honor your return/exchange request.</span></p>
<p><span><span style="font-weight: 400;">** As stated on individual product pages, the outer box/case/sleeve/cover of an item is made for protecting the product underneath. Damage (crushing/tearing/puncturing), spots, scratches, flaws, discoloration, etc. may occur due to the nature of the material or during the manufacturing/packaging/delivery process and <strong>cannot</strong> be a reason for exchange or return. Any fine spots, scratches, flaws, or textural conditions that cannot be seen/identified from a 30cm distance cannot be a reason for exchange or return. Due to the thin paper material of magazines, some corners may naturally curl, bend, fold, or slightly tear during packaging/delivery and cannot be a reason for exchange or return.</span></span></p>
<p><span>For missing items, instead of a return, we will review the Unboxing Video and issue a full refund (if item is out-of-stock) or send a new shipment out as soon as possible.</span></p>
<p><span></span><span>If you wish to return an item(s) because you changed your mind or no longer need/want it, you must email us with your request <strong>within 7 days</strong> of when the shipment was marked as delivered by the courier, as long as it is in its original condition and packaging. If your item is not in its original condition, or if you email us after it has been <strong>more than 7 days</strong>since your shipment was marked as delivered by the courier, only partial refunds can be provided. As this is a personal decision, you will be responsible for shipping charges for this process and a return label will not be provided.</span></p>
<p><span>Please email ask@subkshop.com before shipping the returned item to let us know that you are sending back the item so that our team can keep an eye out for the package. Once the item is received back in the warehouse, our team will examine the item to conclude the condition of the product and issue the refund (minus shipping fees) within <strong>5~7 business days</strong>. Refunds will be issued back to the original form of payment used for purchase, and typically takes about <strong>3~5 business days</strong> for the refund to fully process, but may vary per bank.</span></p>
<p><b>RETURN ADDRESS:</b> <br><span>SUBK SHOP</span> <br><span>ATTN: RETURNS</span> <br><span>1285 N PATT ST,</span> <br><span>ANAHEIM, CA 92801</span></p>
<p><b>PLEASE NOTE:</b><span> Each product may have its own return/exchange policy that is different from our general return policy which will be listed on the individual product page, in which case, the policy of that specific product will supersede our general policy.<br></span></p>
<h3><span style="color: #2ad867;"><b>[ CANCELLATION POLICY ]</b></span></h3>
<p style="text-align: center;"><span style="color: #ff0000;"><b>PLEASE NOTE THAT WE MAY NOT BE ABLE TO ACCOMMODATE CANCELLATION REQUESTS FOR ORDERS INCLUDING CERTAIN PRODUCTS OR COLLECTIONS, SO MAKE SURE TO READ EACH PRODUCT PAGE CAREFULLY.</b></span></p>
<p><span>If you wish to cancel an order that has not been fulfilled/shipped, you can request to do so by sending an email to ask@subkshop.com. Please include your <strong>First</strong> and<strong> Last Name</strong>, <strong>Order Number</strong>, and <strong>Reason for Cancellation</strong> in the email.</span></p>
<hr>
<p><span>Returns&nbsp;&amp; Exchanges Policy subject to change without notice.</span></p>
