    <script>
    function refreshFlairBadges() {
      var els = document.querySelectorAll('#snize_results .snize-product');
      var productIds = [];
      Array.from(els).forEach(function(el) {
        if (/\d+$/.test(el.id)) {
          productIds.push(RegExp.lastMatch)
        }
      });
      if (productIds.length > 0) {
        FlairApp.getProductBadgesMulti({"ids" : productIds}).then(function(badges) {
          var doc = new DOMParser().parseFromString(badges, 'text/html');
          var items = doc.querySelectorAll('.flair-badge-layout');
          items.forEach(function(item) {
            var pid = item.dataset.productId;
            var matches = document.querySelectorAll('#snize-product-' + pid.toString());
            matches.forEach(function(el) {
              if (el.querySelector('.flair-badge-layout') == null) {
                var titleEl = el.querySelector(".snize-title");
                titleEl.after(item.cloneNode(true));
              }
            });
          });
        });
      }
    }
    document.addEventListener('Searchanise.Loaded', function() {
      (function($) {
        $(document).on('Searchanise.ResultsUpdated', function(event, container) {
          refreshFlairBadges();
        });
      })(window.Searchanise.$);
    });
  </script>



<script>
  // Check for smile app redeemable products
  const redeemableProducts = [6665360965893];
  // Check for smile app redeemable products
  (async () => {
      if (location.pathname.includes('/cart') && !!redeemableProducts.length) {
          try {
              const checkoutbutton = document.querySelector("input[type='submit']")
              const res = await fetch('/cart.json')
              const jsonres = await res.json()
              const redeemableProductsInCart = jsonres.items?.filter(item => redeemableProducts.includes(item.product_id))
              if (!!redeemableProductsInCart.length && jsonres.item_count === 1) {
                  console.log("Found just 1 redeemable product in cart")
                  checkoutbutton.disabled = true;
              }
              const hasRedeemableProductTwice = !!(redeemableProductsInCart.map(item => item.quantity).filter(number => number > 1).length)
              if (hasRedeemableProductTwice) {
                  console.log("Found just 1 redeemable product in cart")
                  checkoutbutton.disabled = true;
              }
          } catch (e) {
              console.error('Not able to check for redeemable product', e)
          }
      }
  })();
</script>   


